import { MDBBtn, MDBContainer,MDBRow,MDBCol , MDBCard, MDBCardBody, MDBCardImage, MDBCardTitle, MDBCardText} from "mdbreact";

import './../css/design.css';
import offers_jpg2 from './../images/offers_jpg2.jpg';
import heartrate from './../images/heartrate.png';
const Offer = () => {
  return (
      <div style={{
        backgroundImage: "url(" +offers_jpg2+ ")",
        backgroundPosition: 'center',
        backgroundSize: '100% 100%',
        backgroundRepeat: 'no-repeat',
        textAlign:"left",
        padding:"10px",
        paddingBottom: "4rem"
      }}>

          <MDBRow> <MDBCol lg="12" md="12" sm="12" xs="12"><h1 className="id1 text-center py-1"><img src={heartrate}></img>Offers<img src={heartrate}></img></h1></MDBCol></MDBRow>
          <MDBRow>

            <MDBCol lg="6" md="6" sm="12" xs="12"> 
            <h1 className="id2">Get 0-70% discount  </h1> 
            <p className="id2">On all types of medicine</p>
            <br/>
            <p  className="id2 text-danger">Deals of the day ends in</p>
            <br/>
            {/* <h4  className="id2 text-danger ">04:00:10</h4>
            <br/>
            <MDBBtn  className="id2" rounded color="primary">Order Now</MDBBtn> */}
              <MDBCard className="ml-5" style={{ width: "15rem" }}> 
                <MDBCardBody className="text-center">
                  <MDBCardTitle><h4  className="id2 text-danger ">04:00:10</h4></MDBCardTitle>
                  <MDBBtn className="btn-info w-75 order-btn">Order Now</MDBBtn>
                </MDBCardBody>
              </MDBCard>
            </MDBCol>
           <MDBCol  lg="6" md="6" sm="0" xs="0"></MDBCol>
          </MDBRow>


</div>
    );
}

export default Offer;
